    background-color:var(--transparent);
    height:100%;
    width:60%;
    margin:0px 0px;
    @media(max-width:425px){
        width:100%; 
    }
`

const Text=sytled.p`
    width:80%; 
    color:white;

    padding:10px 0px;
@media(max-width:425px){
    width:100%; 
}
@media(min-width:768px) {
    align-self: center;

}
`

const Headingcontainer=sytled.div`
    text-align:center;

`
const Heading=sytled.h2`
    text-align:center;
    color:white;
    margin:0px;
`


const ContainerInner=sytled.div`
    display:flex;
    padding: 0px 5% 0% 5%;

@media(max-width:768px){
    display:flex;
    flex-direction:column;
}
@media(min-width:769px){

   display:flex;
   flex-direction:row;
}
`

const FormContainer=sytled.div`
    width:Calc(100%/2);
    padding:0px 5% 0px 0% ;
@media(max-width:768px){
    width:Calc(100%/1);
    padding:0px;
}
@media(min-width:1025px){
    width:Calc(100%/3);
}
`


class ContactMe extends Component {

render() { 
    return (

           <Container id="ContactMe" className="overlay">
               <Container1 >
               <Headingcontainer ><Heading className="headings ">Get In Touch</Heading></Headingcontainer>

               <ContainerInner>

                   <Textcontainer>



                <Text >
                Let’s meet for your free consultation, whether on Skype or in person at your favourite coffee spot. Bring along your thoughts, ideas and wishes as I would love to find out about you! Only Cape Town clients will be met in person. 
Please reach out to me by completing the below form, I will get back to your soonest. 

               </Text>



               </Textcontainer>
               <FormContainer >
                    <Forms/>
               </FormContainer>


               </ContainerInner>
               </Container1>
           </Container>

         );
    }
}

export default ContactMe;
